  input: "\"TEXT\",\"F3XA\",\"C00034033\",\"1.\tThe SCGOP is using the following best
    effort to obtain identification of all individuals who contribute in excess of
    $200.  Our original solicitation includes a clear and conspicuous request for
    this information and informs  the contributor of the requirements of the federal
    law for reporting such information.  If the information is not provided, we make
    an oral follow up, stand alone effort  no later than 30 days after receipt of
    the contribution, which we document in writing to obtain this information whether
    the contribution was solicited or not. We clearly ask for the missing information,
    without soliciting a contribution and inform the contributor of the requirements
    of federal law for the reporting of such information.  If the needed information
    is still not provided, we search the internet to obtain the information.  If we
    receive additional information we are either making an amendment for the period
    in question or add a memo stating the changes with our next filing. 2.  Additional
    information about the following contributors has been obtained:  Wilford Broome,
    Mary Gay, H Charles Ford, Connor Isgett, C Heath Manning, Charles McCreight, Mary
    Moates.  Corrections have been made. 3.  The disbursement on Schedule B line 21b
    was for a permit to post signs.  The signs did not promote, support, attack or
    oppose any candidate for Federal office and did not meet the definition of Federal
    Election Activity under 11 CFR 100.24.  The Georgetown GOP refunded this money
    back to us.  4. The disbursement for direct mail to Starboard was for a pocket
    guide.  It did not promote, support, attack or oppose any candidate for Federal
    office and did not meet the definition of Federal Election Activity under 11 CFR
    100.24.  It should have been reported on Schedule B Line 21 b; a correction has
    been made.\""
